import React from "react";
import {BrowserRouter as Router, Route, Routes } from "react-router-dom"
import Home from "./components/Home";
import About from "./components/About"; 
import Skills from "./components/Skills";
import Contact from "./components/Contact";
import Signup from "./components/Signup.js";
import "./App.css";
import "./components/Navbar";
import Navbar from "./components/Navbar";


const App = () => {
  return (
    <Router>
      <Navbar />


        <Routes path="/welcome" components={Home} exact>
          <Home/>
          </Routes>
          <Routes path="/about" components={About} exact>
          <About/>
          </Routes>
          <Routes path="/skills" components={Skills} exact>
          <Skills/>
          </Routes>
          <Routes path="/contact" components={Contact} exact>
          <Contact/>
          </Routes>
          <Routes path="/signup" components={Signup} exact>
          <Signup/>
        </Routes>

    </Router>
  );
}

export default App;
